  return (
    <div className="bg-black w-full h-screen">
    <div className="flex">
      <div className="w-1/12 ">
        <Sidebar />
      </div>
      <div className="w-11/12">
        {/* Outlet will render the matched child route */}
        <Outlet />
      </div>
    </div>
  </div> 
  );
}

export default Main;
